import React from "react";

const Drought = () => {

    return(
        <>

        <iframe src="https://www.drought.gov/historical-information?dataset=0&selectedDateUSDM=20111129&embedded=true" 
        name="Drought.gov Historical Information" scrolling="Yes" height="550px" width="100%"></iframe>
        </>
    )

}

export default Drought;
